// Components/Dashboard.js
import React from 'react';
import Navbar from '../Components/Navbar';
import Sidebar from '../Components/Sidebar';

export default function Dashboard() {
  const colour = { colour: "#FE4747", backgroundcolour: "#FF6B6B29" };

  return (
    <>
      <Navbar />
      <Sidebar colour={colour} />
      <main>
      <div className="ml-64 p-8">
        <div className="text-center">
          <h1 className="text-3xl font-bold mb-4">Welcome to Findmyvenue</h1>
          <p className="text-gray-600 mb-8">Let's get started on creating your profile.</p>
          <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-8">
            <div className="bg-white p-6 rounded-lg shadow-md">
              <h2 className="text-xl font-bold mb-2">Setup Hotel Profile</h2>
            </div>
            <div className="bg-white p-6 rounded-lg shadow-md">
              <h2 className="text-xl font-bold mb-2">Add Venue Details</h2>
            </div>
            <div className="bg-white p-6 rounded-lg shadow-md">
              <h2 className="text-xl font-bold mb-2">Add Restaurants</h2>
              <p className="text-sm text-gray-600">(if applicable)</p>
            </div>
            <div className="bg-white p-6 rounded-lg shadow-md">
              <h2 className="text-xl font-bold mb-2">Add Your Team</h2>
            </div>
          </div>
          <button className="mt-8 bg-red-500 text-white py-2 px-4 rounded">Get Started</button>
          <p className="mt-4 text-red-500 underline">Required Documents List</p>
        </div>
      </div>
      </main>
    </>
  );
}
